    components: {
      'progress-bar': ProgressBar,
      'dom-chart-box': DomChartBox,
      'can-panel': CanDataPanel,
      'map-panel': MapPanel,
      'search-panel': SearchPanel1
    },
    computed: {
      timePlaceHolder(){
        return (this.result[this.index].timestamp)*100
      }
      /*timeOut: {
        set (val) {
          this.$store.state.timeout.compileTimeout = val
        },
        get () {
          return this.$store.state.timeout.compileTimeout
        }
      },*/
    },
    created () {
      if (this.timeOut) {
        clearTimeout(this.timeOut)
      }

      this.miao = this.result.length-1
      this.index = 0

    },
    methods: {
      search (criteria) {
        //console.log(criteria)
        let that = this
        axios.post(
          'http://192.168.3.94:8080/cicv/scenarioLibrary/scenarios',
          criteria,
          {
            headers: {
              'Content-Type': 'application/json;charset=utf-8'
            }
          })
          .then(function (response) {

            //console.log(response)
            if(response.data && response.data.length>0 && !response.data.state ){
              that.hasData = true

              that.result = response.data
              that.reload()
            }
            else{
              that.hasData = false
            }
          })
          .catch(function (error) {
            console.log(error)
          })

      },
      drag (percent) {
        if(percent<=100 && percent>=0){
          this.currentMiao = parseInt(percent / 100 * this.miao)
          this.index = this.currentMiao
        }

      },
      seek (percent) {
        if(percent<=100 && percent>=0) {
          this.currentMiao = parseInt(percent / 100 * this.miao)
          this.index = this.currentMiao
        }
      },
      getNextIndex () {
        let that = this
        this.timeOut = setTimeout(() => {
          //console.log(this.result.length)
          that.index++
          that.currentMiao++
          if (that.index <= that.miao) {
            that.getNextIndex()
          }
          else {
            that.stop()
          }
        }, 100)
      },
      play () {
        if (!this.isPlaying) {
          this.isPlaying = true
          this.getNextIndex()
        }
      },
      pause () {
        if (this.isPlaying) {
          this.isPlaying = false
          clearTimeout(this.timeOut)
        }
      },
      stop () {
        this.isPlaying = false
        clearTimeout(this.timeOut)
        this.index = 0
        this.currentMiao = 0
        this.percent = 0
      },
      formatNum: function (num, i) {
        let result = parseFloat(num)
        if (isNaN(result)) {
          alert('传递参数错误，请检查！')
          return false
        }
        if (i < 1) {
          i = 1
        }
        result = Math.round(num * Math.pow(10, i)) / Math.pow(10, i)
        let s_x = result.toString()
        let pos_decimal = s_x.indexOf('.')
        if (pos_decimal < 0) {
          pos_decimal = s_x.length
          s_x += '.'
        }
        while (s_x.length <= pos_decimal + i) {
          s_x += '0'
        }
        return s_x
      },
      load(){
        this.gpsPoints = this.result.map((x) => {
          return {'latitude': x.gps.latitude, 'longitude': x.gps.longitude}
        })

        //this.percent = this.currentMiao / this.miao * 10

        this.imgLoading()
      },
      imgLoading(){
        //计算图片是否加载完成
        this.imgLength = this.result.length * 3//单目摄像头、标注图、点云图
        let imgs = document.getElementsByClassName('loadimg')
        Array.from(imgs).forEach((item) => {
          let img = new Image()
          img.onload = () => {
            this.count++
            let percentNum = Math.floor(this.count / this.imgLength * 100)
            this.imgPrecent = `${percentNum}%`
          }
          img.src = item.getAttribute('src')
        })
      },
      reload () {
        this.isPlaying = false
        this.currentMiao = 0
        this.percent = 0
        this.count = 0
        this.isLoaded = false
        this.imgPrecent = 0
        this.gpsPoints = []
        this.miao = this.result.length-1
        this.index = 0
        this.load()
      }
    },
    mounted () {
     this.load()
    },
    watch: {
      currentMiao (cur, old) {
        this.percent = cur / this.miao * 100
      },
      count (cur, old) {
        //console.log(cur)
        if (cur === this.imgLength) {
          // 图片加载完成后跳转页面
          this.isLoaded = true
        }
      },
    }
  }
</script>

